import logo from './logo.svg'
import './App.css'
import { useEffect } from 'react'
import pokemonproject from './Assets/pokemonproject.png'

function App() {
  let sprite

  useEffect(() => {
    fetch('https://pokeapi.co/api/v2/pokemon/?limit=20')
      .then((response) => response.json())
      .then((data) => {
        console.log(data.results.name, 'pokemons ')
      })
      .catch((err) => {
        console.log(err.message)
      })
  }, [])

  useEffect(() => {
    fetch('https://pokeapi.co/api/v2/pokemon-form/1')
      .then((response) => response.json())
      .then((data) => {
        console.log(data.sprites.front_default)
        sprite = data.sprites.front_default
      })
      .catch((err) => {
        console.log(err.message)
      })
  }, [])

  return (
    <div className="App">
      <div className="LeftPanel">
        <img src={pokemonproject} className="Logo" alt="Pokemon Logo" />
        <img src={sprite} />
      </div>
      <div className="RightPanel">Right Panel</div>
    </div>
  )
}

export default App
